    18,nt"tags": [],nt"title": "Partial pressure (or fugacity) of carbon dioxide,
    salinity and other variables collected from time series observations using Bubble
    type equilibrator for autonomous carbon dioxide (CO2) measurement, Carbon dioxide
    (CO2) gas analyzer and other instruments from MOORINGS in the North Pacific Ocean
    from 2010-02-23 to 2011-02-27 (NODC Accession 0113238)",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-09-05T23:54:39.333890",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time5d6b0",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0113238 includes chemical,
    physical and time series data collected from MOORINGS in the North Pacific Ocean
    from 2010-02-23 to 2011-02-27. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
    (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT SATURATION, Partial pressure (or
    fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon
    dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
    these data include Bubble type equilibrator for autonomous carbon dioxide (CO2)
    measurement and Carbon dioxide (CO2) gas analyzer.nnThese data were collected by
    Adrienne Sutton, Christopher Sabine, Stacy Maenner and Sylvia Musielewicz of US
    DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the Mooring_TAO165E0N
    data set. CDIAC associated the following cruise ID(s) with this data set: T16520100223nnThe
    Global CO2 Time-series and Moorings Project involves international groups from 18
    countries who have mounted sensors on moored buoys to provide high resolution time-series
    measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
    (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
    Ocean Carbon Coordination Project (IOCCP).",nt"license_title": null,nt"extras":
